    OPTIONAL { ?paramNode onto:nameParameter ?paramName . }
    OPTIONAL { ?paramNode onto:valueParameter ?paramValue . }
  }
}
OPTIONAL {
  ?req onto:resp ?resp .
  OPTIONAL { ?resp onto:sc ?scNode .
            OPTIONAL { ?scNode onto:statusCodeNumber ?statusCode . }
            OPTIONAL { ?scNode onto:reasonPhrase ?reasonPhrase . } }
}
OPTIONAL { ?req onto:reqHeader ?reqHeaderNode .
          OPTIONAL { ?reqHeaderNode onto:fieldName ?reqHeaderName . }
          OPTIONAL { ?reqHeaderNode onto:fieldValue ?reqHeaderValue . } }
OPTIONAL { ?resp onto:resHeader ?resHeaderNode .
          OPTIONAL { ?resHeaderNode onto:fieldName ?resHeaderName . }
          OPTIONAL { ?resHeaderNode onto:fieldValue ?resHeaderValue . } }
OPTIONAL { ?req onto:body ?reqBody . }
OPTIONAL { ?resp onto:body ?respBody . }
FILTER(BOUND(?resp))
FILTER(BOUND(?statusCode))
FILTER(BOUND(?reqBody) || BOUND(?respBody))
FILTER(BOUND(?reqHeaderNode) || BOUND(?resHeaderNode)) } UNION { GRAPH ?g { ?req a onto:Request .
OPTIONAL { ?req onto:id ?reqId . }
OPTIONAL { ?req onto:mthd ?mNode . OPTIONAL { ?mNode onto:methodName ?method . } }
OPTIONAL {
  ?req onto:uriRequest ?uriNode .
  OPTIONAL { ?uriNode onto:uri ?uri . }
  OPTIONAL { ?uriNode onto:scheme ?scheme . }
  OPTIONAL { ?uriNode onto:authority ?authority . }
  OPTIONAL { ?uriNode onto:path ?path . }
  OPTIONAL { ?uriNode onto:query ?query . }
  OPTIONAL { ?uriNode onto:fragment ?fragment . }
  OPTIONAL {
    ?uriNode onto:param ?paramNode .
    OPTIONAL { ?paramNode onto:nameParameter ?paramName . }
    OPTIONAL { ?paramNode onto:valueParameter ?paramValue . }
  }
}
OPTIONAL {
  ?req onto:resp ?resp .
  OPTIONAL { ?resp onto:sc ?scNode .
            OPTIONAL { ?scNode onto:statusCodeNumber ?statusCode . }
            OPTIONAL { ?scNode onto:reasonPhrase ?reasonPhrase . } }
}
