          OPTIONAL { ?reqHeaderNode onto:fieldName ?reqHeaderName . }
          OPTIONAL { ?reqHeaderNode onto:fieldValue ?reqHeaderValue . } }
OPTIONAL { ?resp onto:resHeader ?resHeaderNode .
          OPTIONAL { ?resHeaderNode onto:fieldName ?resHeaderName . }
          OPTIONAL { ?resHeaderNode onto:fieldValue ?resHeaderValue . } }
OPTIONAL { ?req onto:body ?reqBody . }
OPTIONAL { ?resp onto:body ?respBody . }
