PREFIX onto: <http://localhost/onto/ontowebpt#>
PREFIX rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?ruleId (COUNT(DISTINCT ?finding) AS ?findingsCount)
WHERE {
  GRAPH ?gFind {
    ?finding a onto:HttpFinding ;
             onto:findingRuleId ?ruleId .
    {
      ?finding onto:httpFindingOfRequest ?req .
    }
    UNION
    {
      ?req onto:hasHttpFinding ?finding .
    }
  }

  GRAPH ?gReq {
    ?req onto:mthd ?mNode .
    BIND(UCASE(REPLACE(STR(?mNode), "^.*[#/]", "")) AS ?method)
  }

  # "Specific method" parameter (edit as needed)
  VALUES ?targetMethod { "GET" }
  FILTER(?method = ?targetMethod)
}
GROUP BY ?ruleId
ORDER BY DESC(?findingsCount)

