PREFIX rdf:  <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT
  ?req ?reqId ?method ?scheme ?authority ?path ?uri
  ?params
  ?reqHeaders
  ?resHeaders
  ?cookies
  (SAMPLE(?reqBody) AS ?reqBody)
  (SAMPLE(?respBody) AS ?respBody)
WHERE {
  # Pick one "selected" request that has at least one HTTP finding.
  # Replace this subquery with: VALUES ?req { <YOUR_REQUEST_IRI> } when you want an explicit request.
  {
    SELECT DISTINCT ?req WHERE {
      GRAPH ?gFind {
        ?f a onto:HttpFinding .
        { ?f onto:httpFindingOfRequest ?req . }
        UNION
        { ?req onto:hasHttpFinding ?f . }
      }
    } LIMIT 1
  }

  GRAPH ?gReq {
    OPTIONAL { ?req onto:id ?reqId . }
    OPTIONAL { ?req onto:mthd ?mNode . BIND(UCASE(REPLACE(STR(?mNode), "^.*[#/]", "")) AS ?method) }
    OPTIONAL {
      ?req onto:uriRequest ?uriNode .
      OPTIONAL { ?uriNode onto:uri ?uri . }
      OPTIONAL { ?uriNode onto:scheme ?scheme . }
      OPTIONAL { ?uriNode onto:authority ?authority . }
      OPTIONAL { ?uriNode onto:path ?path . }
    }
    OPTIONAL { ?req onto:body ?reqBody . }
    OPTIONAL {
      ?req onto:resp ?resp .
      OPTIONAL { ?resp onto:body ?respBody . }
    }
  }

  # Aggregate URL parameters (query string)
  OPTIONAL {
    SELECT ?req (GROUP_CONCAT(DISTINCT CONCAT(?pName, "=", COALESCE(STR(?pVal), "")); separator="&") AS ?params)
    WHERE {
      GRAPH ?gReq {
        ?req onto:uriRequest ?u .
        ?u onto:param ?p .
        OPTIONAL { ?p onto:nameParameter ?pName . }
        OPTIONAL { ?p onto:valueParameter ?pVal . }
      }
    }
    GROUP BY ?req
  }

  # Aggregate request headers
  OPTIONAL {
    SELECT ?req (GROUP_CONCAT(DISTINCT CONCAT(?hn, ": ", COALESCE(STR(?hv), "")); separator=" | ") AS ?reqHeaders)
    WHERE {
      GRAPH ?gReq {
        ?req onto:reqHeader ?h .
        OPTIONAL { ?h onto:fieldName ?hn . }
        OPTIONAL { ?h onto:fieldValue ?hv . }
      }
    }
    GROUP BY ?req
  }

  # Aggregate response headers (only if response exists)
  OPTIONAL {
    SELECT ?req (GROUP_CONCAT(DISTINCT CONCAT(?hn, ": ", COALESCE(STR(?hv), "")); separator=" | ") AS ?resHeaders)
    WHERE {
      GRAPH ?gReq {
        ?req onto:resp ?r .
        ?r onto:resHeader ?h .
        OPTIONAL { ?h onto:fieldName ?hn . }
        OPTIONAL { ?h onto:fieldValue ?hv . }
      }
    }
    GROUP BY ?req
  }

  # Aggregate cookies via header names containing "cookie" (Cookie / Set-Cookie, etc.)
  OPTIONAL {
    SELECT ?req (GROUP_CONCAT(DISTINCT CONCAT(?hn, ": ", COALESCE(STR(?hv), "")); separator=" | ") AS ?cookies)
    WHERE {
      GRAPH ?gReq {
        {
          ?req onto:reqHeader ?h .
        }
        UNION
        {
          ?req onto:resp ?r .
          ?r onto:resHeader ?h .
        }
        ?h onto:fieldName ?hn .
        OPTIONAL { ?h onto:fieldValue ?hv . }
        FILTER(regex(str(?hn), "cookie", "i"))
      }
    }
    GROUP BY ?req
  }
}
GROUP BY ?req ?reqId ?method ?scheme ?authority ?path ?uri ?params ?reqHeaders ?resHeaders ?cookies
LIMIT 50

